import * as React from 'react'
import { Button, Typography } from '@mui/material'

const StartQuizButton = ({text, fontSize}) => {
  return (
    <Button 
      variant="contained" 
      onClick={() => window.location.href = '/quiz'}
    >
      <Typography fontSize={ fontSize || 25}>
        {text}
      </Typography>
    </Button>
  )
}

export default StartQuizButton
